import React, { useState } from "react";
import "antd/dist/antd.css";
import { Link } from "react-router-dom";
import { Input, Switch } from "antd";

import logo from "../images/icon.png";
import classes from "./Navbar.module.css";
import Subnav from "./subnav";

import PopupExample from "../Alerts/model";
import ModalPage from "./subnav";

const Nave = (props) => {
    const [col, setcol] = useState("black");
  //false
  let inputStyle = {
    color: "white",
  };
  //true
  let inputStyle2 = {
    color: "black",
  };
  function onChange(checked) {
    if (checked) {
      props.ColorChanger();
      setcol(inputStyle2.color);
      console.log(col);
    } else {
      props.ColorChanger();
      setcol(inputStyle.color);
      console.log(col);
    }
  }
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <Link className="navbar-brand" 
        style={{ color: `${col}`, marginLeft: "50px" }}
        className={classes.icon}
        to="/"
      >
        <img
          alt=""
          src={logo}
          width="30"
          height="30"
          className="d-inline-block align-top"
        />{" "}
        CoinStats
        </Link>
        <Switch
        style={{ marginLeft: "180px" }}
        defaultChecked
        onChange={onChange}
      />
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon" />
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item active">
              <Link style={{ color: `${col}` }} className="nav-link" to="/portfoliotracker">
                PortFolio Tracker <span className="sr-only">(current)</span>
              </Link>
            </li>
            <li className="nav-item">
              <Link style={{ color: `${col}` }}  className="nav-link" to="/">
                Live Pricing
              </Link>
            </li>
            <li className="nav-item">
              <Link style={{ color: `${col}` }}  className="nav-link" to="/pricing">
                Pricing
              </Link>
            </li>
            <li className="nav-item">
              <Link style={{ color: `${col}` }}  className="nav-link" to="">
                Alerts
              </Link>
            </li>
            <li className="nav-item dropdown">
              <Link
                className="nav-link dropdown-toggle"
                href="#"
                id="navbarDropdown"
                role="button"
                data-toggle="dropdown"
                aria-haspopup="true"
                aria-expanded="false"
              >
                Dropdown
              </Link>
              <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                <Link className="dropdown-item" href="#">
                  Action
                </Link>
                <Link className="dropdown-item" href="#">
                  Another action
                </Link>
                <div className="dropdown-divider" />
                <Link className="dropdown-item" href="#">
                  Something else here
                </Link>
              </div>
            </li>
            <li className="nav-item">
              <Link className="nav-link disabled" href="#">
                Disabled
              </Link>
            </li>
          </ul>
          <form className="form-inline my-2 my-lg-0">
            <input
              className="form-control mr-sm-2"
              type="search"
              placeholder="Search"
              aria-label="Search"
            />
            <button
              className="btn btn-outline-success my-2 my-sm-0"
              type="submit"
            >
              Search
            </button>
          </form>
        </div>
      </nav>
    </div>
  );
};

export default Nave;
